function loadAssignments(){var table=document.querySelector("tbody"),template=document.querySelector("#assignmentRow"),content=template.content,cells=content.querySelectorAll("td");DataService.getUsersAssignments(AuthService.getUser()._key).success(function(data){for(var i=0;i<data.length;i++){cells[0].querySelector(".paper").textContent="test",cells[1].querySelector(".completion").style.width="15%",cells[1].querySelector(".completion").textContent="15%";var clone=document.importNode(content,!0);table.appendChild(clone)}})}$(document).ready(function($){Site.run(),loadAssignments()});